IMO it would be better to use a `LinkedHashSet` instead and thus preserve the order of the elements:
```diff
diff --git i/wicket-core/src/main/java/org/apache/wicket/markup/html/form/FormComponent.java w/wicket-core/src/main/java/org/apache/wicket/markup/html/form/FormComponent.java
index 3286dae26b..99e6d77bce 100644
--- i/wicket-core/src/main/java/org/apache/wicket/markup/html/form/FormComponent.java
+++ w/wicket-core/src/main/java/org/apache/wicket/markup/html/form/FormComponent.java
@@ -1665,7 +1665,7 @@ public abstract class FormComponent<T> extends LabeledWebMarkupContainer impleme
        private static <S> Collection<S> newCollection(Class<?> hint, Collection<S> elements)
        {
                if (Set.class.isAssignableFrom(hint)) {
-                       return new HashSet<>(elements);
+                       return new LinkedHashSet<>(elements);
                } else {
                        return new ArrayList<>(elements);
                }
```

@svenmeier Do you see any problems with this ?
All unit tests pass!
